Explicación: Este es un soneto satírico de Lope de Vega (Félix Lope de Vega y Carpio), un famoso dramaturgo y poeta español del Siglo de Oro. El poema juega con el lenguaje coloquial y hace una parodia de una conversación sobre una expedición militar, utilizando juegos de palabras y un tono humorístico. Lope de Vega vivió entre finales del siglo XVI y principios del siglo XVII (1562-1635), por lo que se ubica en el siglo 17.
